In a brand new three-part series, Griff Rhys Jones sets out to discover what defines the character of the world`s greatest cities - London, Paris and New York.

Exploring a 24-hour day-in-the-life of each metropolis, Griff is on a mission to find out what props up and forms each city key attributes. He leads us on a journey of rediscovery and of extraordinary surprises behind and inside the familiar.

Iconic urban jungles, these cities are swarming with millions of people, their lives interdependent, their stories interconnecting.  How do they all get fed?  Where does the day start for a loaf of bread, or end for a newspaper?  Who are the people that work through the night to make London the most powerful business centre, New York the most innovative, or Paris the most indulgent?


